def task_func(data: np.ndarray, threshold: float = 2.0) -> list:
    if data.size == 0:
        return [], 0.0, 0.0
    mean = np.mean(data)
    std = np.std(data)
    if std == 0:
        return [], mean, 0.0
    z_scores = (data - mean) / std
    outliers = np.where(np.abs(z_scores) > threshold)[0].tolist()
    return outliers, mean, np.var(data)

