def task_func(MIN_WORDS, MAX_WORDS, WORDS_POOL):
    length = random.randint(MIN_WORDS, MAX_WORDS)
    words = random.choices(WORDS_POOL, k=length)
    if length % 2 == 0:
        first_half = words[:length//2]
        second_half = first_half[::-1]
    else:
        first_half = words[:length//2 + 1]
        second_half = first_half[:-1][::-1]
    palindrome_words = first_half + second_half
    return ' '.join(palindrome_words)

